import React, { useState } from 'react';
import classes from './MyModalNavigation.module.css';

const MyModalNavigation = ({ visible, setVisible }) => {
 
  const rootClasses = [classes.myModalNavigation];
  const [deliveryMenuActive, setDeliveryMenuActive] = useState(false);
  const [contactsMenuActive, setContactsMenuActive] = useState(false);
  const [faqMenuActive, setFaqMenuActive] = useState(false);
  const [telegramMenuActive, setTelegramMenuActive] = useState(false);

  const handleClick = () => {
    setVisible(false);
  };

  if (visible) {
    rootClasses.push(classes.active);
  }

  const toggleDeliveryMenu = () => {
    setDeliveryMenuActive(!deliveryMenuActive);
  };

  const toggleContactsMenu = () => {
    setContactsMenuActive(!contactsMenuActive);
  };

  const toggleFaqMenu = () => {
    setFaqMenuActive(!faqMenuActive);
  };

  const toggleTelegramMenu = () => {
    setTelegramMenuActive(!telegramMenuActive);
  };


  return (
    <div className={rootClasses.join(' ')}>
      <div className={classes.myModalNavigation__overlay} onClick={handleClick} />
      <div className={classes.myModalNavigation__line} style={{marginTop: 93}}></div>
      <div className={classes.myModalNavigation__title}>КАТЕГОРИИ</div>
      <div className={classes.myModalNavigation__line} style={{marginBottom: 15}}></div>
      <div className={classes.myModalNavigation__link}>НОВЫЕ ПОСТУПЛЕНИЯ</div>
      <div className={classes.myModalNavigation__link} style={{color: '#AC8BD5'}}>Б/У КРОССОВКИ</div>
      <div className={classes.myModalNavigation__link}>АКСЕССУАРЫ</div>
      <div className={classes.myModalNavigation__link}>ОДЕЖДА</div>
      <div className={classes.myModalNavigation__link}>БРЕНДЫ</div>
      <div className={classes.myModalNavigation__link} style={{color: '#AC8BD5'}}>ПРЕДЗАКАЗ</div>
      <div className={classes.myModalNavigation__link}>НОВЫЕ КРОССОВКИ</div>
      <div className={classes.myModalNavigation__line} style={{marginTop: 10}}></div>
      <div className={classes.myModalNavigation__title}>О НАС</div>
      <div className={classes.myModalNavigation__line} style={{marginBottom: 15}}></div>
      <div className={classes.myModalNavigation__accordion}>
      <ul>
        <li
          className={classes.myModalNavigation__link}
          onClick={toggleDeliveryMenu}
        >
          ДОСТАВКА И ОПЛАТА
        </li>
        {deliveryMenuActive && (
          <li className={classes.myModalNavigation__content}>
            <br />Если Москва, то самовывоз
            <br />Метро Ботанический Сад. 5 мин от метро
            <br />
            <br />Также есть доставка по предоплате Яндекс курьером в любую
            точку
            <br />Москвы за ваш счёт.
            <br />
            <br />Если нужна отправка по стране/зарубеж, то она возможна
            почтовыми
            <br />службами :
            <br />
            <br />Сдэк / Почта РФ / Боксберри Доставка в регионы 500-1000₽
            <br />
            <br />
          </li>
        )}
      </ul>
      <ul>
        <li
          className={classes.myModalNavigation__link}
          onClick={toggleContactsMenu}
        >
          КОНТАКТЫ
        </li>
        {contactsMenuActive && (
          <li className={classes.myModalNavigation__content}>
            <a href="https://t.me/NiceDunksOrder">ПОЗИЦИИ ПОД ЗАКАЗ</a>
          </li>
        )}
      </ul>
      <ul>
        <li
          className={classes.myModalNavigation__link}
          onClick={toggleFaqMenu}
        >
          ВОПРОС-ОТВЕТ
        </li>
        {faqMenuActive && (
          <li className={classes.myModalNavigation__content}></li>
        )}
      </ul>
      <ul>
        <li
          className={classes.myModalNavigation__link}
          onClick={toggleTelegramMenu}
        >
          ТЕЛЕГРАММ КАНАЛ
        </li>
        {telegramMenuActive && (
          <li className={classes.myModalNavigation__content}></li>
        )}
      </ul>
      </div>
    </div>
  );
};

export default MyModalNavigation;
